import React from "react";

const FilterForm = ({}) => {
  return (
    <div>
      <span>キーワード絞り込み</span>
      <form action="">
        <input type="text" placeholder="search" onChange={this.filterList} />
      </form>
      <div>
        {this.state.items.map((item, index) => {
          return <li key={index}>{item}</li>;
        })}
      </div>
    </div>
  );
};

export default FilterForm;
